content.css:
#top-nav-bar {
    display: flex;
    position: absolute;
    top: 0;
    height: 30px;
    padding: 0px 10px;
    right: 0;
}

#top-nav-bar .nav-items {
    display: flex;
    height: 100%;
    flex-direction: row-reverse;
    align-items: center;
    text-align: center;
    font-size: 16px;
    color: #333;
}

.nav-items.right {
    justify-content: end;
    text-align: right;
}

.nav-items.left {
    justify-content: start;
    text-align: left;
}

.nav-items.right > div {
    width: 30px;
    height: 30px;
}

.vbi-info-icon {
    order: 2;
    width: 28px;
    height: 22px !important;
    margin-left: 2px;
    margin-top: -2px;
}

.vbi-display-data-icon {
    order: 3;
}

.nav-items.right .icon {
    font-size: 24px;
}

.vbi-display-data-icon .icon:hover {
    color: #0078d4;
}

.vbi-display-data-icon img {
    width: 28px;
    height: 26px;
    margin-top: 2px;
    margin-right: 2px;
}

.vbi-license-alert-icon {
    order: 1;
    width: 21px !important;
    height: 21px !important;
    margin-top: 2px;
    margin-right: 2px;
}

#vbi-annotation-icon {
    order: 5;
    height: auto;
    width: auto;
}
div#vbi-annotation-icon span {
    font-size: 18px;
    line-height: 32px;
    width: 30px;
    height: 30px;
    color: #666666;
}
div#vbi-annotation-icon span.active {
    color: #0078d4;
}

.isEditMode #vbi-edit-icon {
    top: 75px !important;
}

.isEditMode #top-nav-bar {
    top: 40px;
}

/*Settings Icon is Only IBCS Components*/
#pbi-icon-container .settings_icon {
    order: 4;
    padding-left: 14px;
}

.editor-icon {
    order: 7;
    width: 27px !important;
    height: 27px !important;
    border-radius: 50%;
    background-color: #f2c811;
    opacity: 0.8;
    text-align: center;
    line-height: 28px;
    margin-right: 8px;
}
.editor-icon .icon {
    font-size: 12px !important;
    color: #000;
}

.editor-icon:hover {
    -webkit-box-shadow: -5px 4px 20px 2px rgba(20, 20, 20, 0.2);
    -moz-box-shadow: -5px 4px 20px 2px rgba(20, 20, 20, 0.2);
    box-shadow: -5px 4px 20px 2px rgba(20, 20, 20, 0.2);
    opacity: 1;
}

.editor-icon img {
    border-style: none;
    width: 13px;
    position: relative;
    top: 1px;
    left: 1px;
}

/**** Customize Fonts ****/
@font-face {
  font-family: 'Helvetica, sans-serif';
  src: url(data:application/vnd.ms-fontobject;charset=utf-8;base64,);
  src: url(data:application/vnd.ms-fontobject;charset=utf-8;base64,?#iefix) format('eot'), url(data:font/woff2;charset=utf-8;base64,) format('woff2'), url(data:font/woff;charset=utf-8;base64,) format('woff'), url(data:font/ttf;charset=utf-8;base64,) format('truetype');
}
@font-face {
  font-family: 'Eurostile, sans-serif';
  src: url(data:font/woff;charset=utf-8;base64,) format('eot'), url(data:font/woff2;charset=utf-8;base64,) format('woff2') format('truetype');
}
@font-face {
  font-family: 'FabricMDL2Icons';
  src: url(data:application/vnd.ms-fontobject;charset=utf-8;base64,);
  src: url(data:application/vnd.ms-fontobject;charset=utf-8;base64,?#iefix) format('embedded-opentype'), url(data:font/woff2;charset=utf-8;base64,) format('woff2'), url(data:font/woff;charset=utf-8;base64,) format('woff'), url(data:font/ttf;charset=utf-8;base64,) format('truetype'), url(data:image/svg+xml;charset=utf-8;base64,#font) format('svg');
  font-weight: normal;
  font-style: normal;
}
@media screen and (-webkit-min-device-pixel-ratio: 0) {
  @font-face {
    font-family: 'FabricMDL2Icons';
    src: url(data:image/svg+xml;charset=utf-8;base64,#fabric-icons) format('svg');
  }
}
.info-container {
  height: 100%;
}
.info-message {
  vertical-align: middle;
  position: relative;
  top: 50%;
  transform: translateY(-50%);
  text-align: center;
  font-family: 'Segoe UI', wf_segoe-ui_normal, helvetica, arial, sans-serif;
  font-size: 14px;
  padding: 10px;
}
.loader {
  border: 5px solid #d5d6d8;
  border-radius: 50%;
  border-top: 5px solid #555;
  width: 20px;
  height: 20px;
  display: inline-block;
  -webkit-animation: spin 1s linear infinite;
  animation: spin 1s linear infinite;
}
/* Safari */
@-webkit-keyframes spin {
  0% {
    -webkit-transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(360deg);
  }
}
@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}
.error-indicator {
  width: 35px;
  height: 35px;
  display: inline-block;
}
.vbi-logo {
  width: 35vh;
  height: 13vh;
  max-width: 93px;
  max-height: 30px;
}
.vbi-logo-gray {
  background-image: url('data:image/png;base64,');
}
.vbi-logo-color {
  background-image: url('data:image/png;base64,');
}
.background-image {
  background-repeat: no-repeat;
  background-size: contain;
}
.close-icon .edit-icon-img {
  display: none !important;
}
.edit-icon .close-icon-img {
  display: none !important;
}
.modal-close-button {
  height: 13px;
  width: 12px;
  right: 4px;
  position: absolute;
  top: 2px;
  z-index: 60;
}
.close-icon-2 {
  background-image: url('data:image/png;base64,');
}
.close-icon-2:hover {
  background-image: url('data:image/png;base64,');
}
.vbi-info-icon {
  background-image: url('data:image/svg+xml;base64,');
}
.vbi-info-icon.edit-mode {
  background-image: url('data:image/svg+xml;base64,');
}
.resize-chart {
  height: calc(100% - 40px) !important;
}
.vbi-smoke-screen .modal-close-button {
  display: none !important;
}
.vbi-license-alert-icon {
  height: 24px !important;
  width: 24px !important;
  top: -2px;
  position: relative;
  background-image: url('data:image/svg+xml;base64,');
}
.vbi-info-icon:hover {
  background-image: url('data:image/svg+xml;base64,');
  opacity: 0.5;
}
.vbi-info-icon.edit-mode:hover {
  background-image: url('data:image/svg+xml;base64,');
  opacity: 1;
}
@media (max-width: 231px), (max-height: 151px) {
  .vbi-logo {
    width: 40px;
    height: 15px;
  }
  .vbi-logo-gray {
    width: 40px;
    height: 15px;
    background-image: url('data:image/png;base64,');
  }
}
@media screen and (max-height: 245px) {
  .vbi-license-modal {
    height: 150px !important;
  }
}
.vbi-smoke-screen .vbi-logo-color {
  background-image: url('data:image/svg+xml;base64,');
}
.vbi-error-url a {
  text-decoration: underline;
  color: #f2c811;
}
.vbi-smoke-screen .vbi-error-url a {
  color: blue;
}
.right-bottom-ps {
  position: absolute;
  bottom: 4px;
  right: 4px;
  z-index: 10000000;
}
.right-top-ps {
  position: absolute;
  z-index: 10000000;
  top: 30px;
  right: 4px;
}
.vbi-smoke-screen {
  width: 100%;
  bottom: 0;
  position: absolute;
  background: rgba(250, 250, 250, 0.1);
  z-index: 999;
}
.vbi-smoke-screen .error-span {
  font-size: 20px;
}
.resize-chart {
  width: calc(100% - 400px);
  left: 400px;
}
.remove-resize-chart {
  width: 100% !important;
  left: 0% !important;
}
.resize-chart-right {
  width: calc(100% - 400px);
  right: 400px;
}
.remove-resize-chart-right {
  width: 100% !important;
  right: 0% !important;
}
.infiniteBottom {
  top: 1000000px !important;
}
.plot-area {
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0%;
}
.editor--show {
  display: block;
}
.vbi-kpi-tile .kpi-label {
  font-size: 15vh;
  font-weight: 100;
  color: #888484;
}
.vbi-kpi-tile .kpi-value {
  font-size: 20vh;
}
.vbi-show-landing-page {
  width: 100%;
  height: 100%;
  min-width: 500px;
  min-height: 400px;
  vertical-align: middle;
  position: relative;
  top: 30%;
  transform: translateY(-30%);
  text-align: center;
  font-family: 'Segoe UI', wf_segoe-ui_normal, helvetica, arial, sans-serif;
  font-size: 25px;
  padding: 10px;
}
.vbi-landing-message {
  position: relative;
  top: 40%;
  transform: translateY(-50%);
}
.vbi-title-span {
  height: 10%;
  font-weight: bold;
  font-size: 35px;
}
.vbi-info-url {
  padding: 10px;
}
.vbi-info-url a {
  text-decoration: underline;
  color: #010080;
}
.vbi-logo-div {
  background-image: url('data:image/png;base64,');
  background-position: center;
  margin: auto;
  height: 60px;
  width: 180px;
}
.pro-used-msg,
.buy-licence,
.renew-licence,
.licence-expired-msg,
.no-licence-msg,
.thanks-msg,
.invalid-licence-msg {
  display: none;
}
.invalid-licence .invalid-licence-msg,
.invalid-licence .buy-licence {
  display: block !important;
}
.pro-user .thanks-msg {
  display: block !important;
}
.no-licence .no-licence-msg,
.no-licence .buy-licence {
  display: block !important;
}
.no-license-pro-used .pro-used-msg,
.no-license-pro-used .buy-licence {
  display: block !important;
}
.licence-expired .licence-expired-msg,
.licence-expired .renew-licence {
  display: block !important;
}
.vbi-licence-modal {
  background: #fff;
  box-shadow: 0 8px 20px rgba(0, 0, 0, 0.3);
  align-items: center;
  color: black;
  font-family: 'Segoe UI', wf_segoe-ui_normal, helvetica, arial, sans-serif;
  top: 42px;
  right: 4px;
  position: absolute;
  z-index: 200;
}
.vbi-licence-modal.pro-user {
  max-height: 220px !important;
}
.vbi-licence-modal.licence-expired {
  max-height: 240px !important;
}
.vbi-licence-modal.editor-icon-present {
  z-index: 99;
}
@media only screen and (max-width: 600px) {
  .vbi-licence-body-item,
  .footer-item {
    width: 100% !important;
  }
  .copy-rights {
    text-align: left !important;
    padding-left: 0px !important;
  }
  .warning-message {
    padding-top: 10px;
  }
  .vbi-licence-modal {
    max-height: 425px !important;
  }
  .vbi-licence-modal.pro-user {
    max-height: 290px !important;
  }
  .vbi-licence-modal.licence-expired {
    max-height: 370px !important;
  }
}
.vbi-licence-modal-item {
  width: 100%;
}
.version-info {
  cursor: pointer;
}
.vbi-logo-licence {
  cursor: pointer;
}
.version-info:hover,
.buy-licence a:hover {
  color: #f2c811 !important;
}
.vbi-logo-licence img {
  height: 25px;
}
.vbi-licence-header {
  display: flex;
  padding-bottom: 7px;
  justify-content: space-between;
  border-bottom: 1px solid #efefef;
  align-items: center;
}
.vbi-licence-modal .chart-name {
  padding: 0px 5px;
  font-weight: 600;
  height: 100%;
}
.vbi-licence-modal .vbi-licence-body {
  padding: 5px;
}
.vbi-licence-modal .info-message-licence {
  width: 50%;
  font-size: 12px;
  padding: 0px 10px;
  box-sizing: border-box;
}
.vbi-licence-modal .info-menu {
  width: 50%;
  padding: 0px 10px;
  box-sizing: border-box;
}
.vbi-licence-modal .menu-item {
  text-transform: uppercase;
  font-weight: 500;
  font-size: 13px;
  padding-bottom: 2px;
  color: #616161;
  cursor: pointer;
}
.vbi-licence-modal .footer a:hover,
.vbi-licence-modal .menu-item:hover {
  color: #f2c811;
}
.vbi-licence-modal .footer {
  border-top: 1px solid #efefef;
  font-size: 12px;
  padding-left: 5px;
  padding-top: 5px;
  color: gray;
  display: flex;
  justify-content: space-between;
  padding-bottom: 10px;
}
.vbi-licence-modal .copy-rights {
  text-align: right;
  width: 30%;
  padding: 0px 5px;
}
.vbi-licence-modal .feedback-link {
  width: 70%;
}
.free-trial-btn {
  margin-top: 5px;
  padding: 8px 8px;
  text-transform: uppercase;
  font-weight: 500;
  text-align: center;
  background: linear-gradient(to right, #eaeaea 50%, #f2c811 50%);
  background-size: 200% 100%;
  background-position: left bottom;
  transition: all 2s ease;
  cursor: pointer;
}
.free-trial-btn:hover {
  background-position: right bottom;
}
.buy-licence {
  padding-top: 5px;
}
.vbi-licence-modal .email-ui input {
  border: 1px solid #efefef;
  width: 100%;
  margin-top: 5px;
  box-sizing: border-box;
  padding: 6px;
}
.flex-container {
  display: flex;
  flex-direction: column;
}
.help-modal::-webkit-scrollbar {
  width: 8px;
}
.help-modal::-webkit-scrollbar-track {
  background-color: #e2e0e0;
}
.help-modal::-webkit-scrollbar-thumb {
  border-radius: 10px;
  background-color: #a0a0a0;
}
/*help modal*/
.help-modal {
  background-color: #ffffff;
  font-family: 'Segoe UI', wf_segoe-ui_normal, helvetica, arial, sans-serif;
  box-shadow: 0 0 20px #bbb;
  width: 430px;
  height: 170px;
  right: 0;
  top: 150px;
  display: none;
  padding: 16px 16px 4px 16px;
  color: #333333;
  box-sizing: border-box;
}
.help-modal .header {
  text-align: center;
}
.help-modal-logo {
  width: 55px;
  height: 18px;
}
.xviz-icon-full {
  background-repeat: no-repeat;
  background-size: cover;
  background-image: url('data:image/svg+xml;base64,');
}
.help-modal h3 {
  font-size: 18px;
  font-weight: 400 !important;
  padding-left: 15px;
  margin: 0;
}
.ratings {
  display: inline;
}
.help-modal .close-modal {
  position: absolute;
  right: 16px;
  top: 16px;
  cursor: pointer;
  font-size: 14px;
  width: 20px;
  height: 20px;
  background-image: url('data:image/svg+xml;base64,');
}
.section {
  float: left;
  width: 33.33%;
}
.section .section-label {
  font-size: 14px;
  line-height: 14px;
  text-transform: uppercase !important;
  font-weight: 500 !important;
}
.help-link {
  display: block;
  font-size: 12px;
  text-decoration: none;
  box-shadow: none !important;
  color: #333333;
  line-height: 24px;
}
span.help-link:visited,
span.help-link:active,
span.help-link:focus {
  color: #333;
}
span.help-link:hover {
  color: #194a9f;
  text-decoration: none;
}
.licence-section {
  font-size: 12px;
  box-shadow: none !important;
  color: #333333;
}
.modal-footer {
  border-top: 1px solid #eaeaea;
  margin-top: 14px;
}
.modal-footer > p {
  font-size: 12px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
  font-weight: 400 !important;
  display: inline-block;
  width: 50%;
  cursor: default;
}
.copyright {
  text-align: right;
}
.bold {
  font-weight: bold;
}
.vbi-licence-body,
.modal-footer {
  float: left;
  width: 100%;
}
.help-modal {
  float: left;
}
@media (max-width: 480px) {
  .help-modal {
    width: 100%;
    overflow-x: auto;
  }
  .section,
  .modal-footer > p {
    width: 100%;
  }
  .modal-footer > p {
    margin-bottom: 0;
  }
  .modal-footer .copyright {
    text-align: left;
  }
}
@media (max-height: 230px) {
  .help-modal {
    overflow-y: scroll !important;
    height: 75px !important;
  }
}
@media (max-width: 230px) {
  .help-modal {
    width: 150px !important;
  }
  .vbi-licence-modal .vbi-licence-body p {
    font-size: 10px !important;
  }
}
/*Info & Edit Iocn Positions*/
/* 
@media (max-width: 231px),
(max-height: 151px) {
    .vbi-info-icon {
        width: 15px;
        height: 15px;
        right: 0px;
        margin: 4px !important;
    }
} */
.highcharts-button-hover rect,
.highcharts-button-pressed {
  fill: #ffffff !important;
  stroke: #ffffff !important;
}
@font-face {
  font-family: 'FabricMDL2Icons';
  src: url('data:application/octet-stream;base64,') format('truetype');
}
.ms-Icon {
  -moz-osx-font-smoothing: grayscale;
  -webkit-font-smoothing: antialiased;
  display: inline-block;
  font-family: 'FabricMDL2Icons';
  font-style: normal;
  font-weight: normal;
}
.ms-Icon--Info:before {
  content: '\E946';
}
.ms-Icon--InfoSolid:before {
  content: '\F167';
}
/* 
  Landing Page CSS
*/
.landing-page-wrapper {
  position: absolute;
  top: 0;
  max-width: 100vw;
  left: 0;
  width: 100vw;
  height: 100vh;
  z-index: 100000000;
  overflow: hidden;
  box-sizing: border-box;
  display: grid;
  grid-template-rows: auto auto auto;
}
.landing-background-overlay {
  width: 100%;
  height: 100%;
  position: absolute;
  background: white;
  opacity: 0.75;
  top: 0;
  left: 0;
  z-index: -1;
}
.landing-page-header {
  width: 100%;
  max-width: 100vw;
  box-sizing: border-box;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 25px 0 25px;
  flex-wrap: wrap;
}
.landing-page-header > img {
  height: 70px;
}
.landing-page-header > h2 {
  font-weight: 450;
  font-size: 32px;
}
.landing-page-body {
  width: 100%;
  max-width: 100vw;
  display: flex;
  align-items: center;
  justify-content: space-around;
  flex-direction: column;
}
.landing-page-body .warning-message {
  margin: 0.2rem 0.5rem;
  padding: 0.3rem 1rem 0.3rem 1rem;
  background-color: #fed9cc;
  color: #201f1e;
  text-align: center;
}
.landing-page-button {
  outline: none;
  text-align: center;
  width: 180px;
  padding: 10px 0 10px 0;
  font-size: 1em;
  box-sizing: border-box;
  display: flex;
  align-items: center;
  justify-content: center;
  border-radius: 5px;
  box-shadow: 0 0 3px 0 gray;
  text-decoration: none !important;
  color: black !important;
}
.landing-page-button:visited,
.landing-page-button:active,
.landing-page-button:hover {
  text-decoration: none !important;
  color: black !important;
}
.landing-page-button:hover {
  opacity: 0.8;
}
.landing-page-footer {
  width: 100%;
  max-width: 100vw;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  box-sizing: border-box;
  padding: 0 10px 0 10px;
}
.landing-page-footer > p {
  font-weight: 500;
  text-align: center;
}
.landing-page-footer > p > a {
  text-decoration: none;
  color: #1e7ce9;
  white-space: nowrap;
}
.landing-page-footer-chart-showcase-wrapper {
  display: flex;
  flex-direction: row;
  box-sizing: border-box;
}
.footer-chart-showcase {
  width: 150px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
.footer-chart-showcase > img {
  height: 70px;
}
.footer-chart-showcase > p {
  font-size: 14px;
  margin-top: -7px;
}
.bg-yellow {
  background: #f2c811;
}
.bg-gray {
  background: #f4f4f4;
}
@media only screen and (max-width: 700px) {
  .footer-chart-showcase:nth-child(2n) {
    display: none;
  }
  .landing-page-header > img {
    height: 50px;
  }
  .landing-page-header > h2 {
    font-size: 22px;
  }
  .landing-page-button {
    width: 140px;
  }
  .landing-page-footer {
    font-size: 16px;
  }
  .footer-chart-showcase > img {
    height: 50px;
  }
  .footer-chart-showcase > p {
    font-size: 12px;
    margin-top: -7px;
  }
}
@media only screen and (max-width: 400px) {
  .header {
    padding: 0 10px 0 10px;
  }
  .landing-page-body .warning-message {
    font-size: 14px;
  }
  .landing-page-footer {
    display: none;
  }
  .footer-chart-showcase {
    display: none;
  }
  .landing-page-header > img {
    height: 30px;
  }
