}
.menu .menu-item .form-checkbox,
.menu .menu-item .form-radio,
.menu .menu-item .form-switch {
  margin: 0.1rem 0;
}
.menu .menu-item + .menu-item {
  margin-top: 0.2rem;
}
.menu .menu-item > button {
  font-size: 13px;
  width: 100%;
  padding: 6px 12px;
  justify-content: flex-start;
  background-color: transparent;
