  line-height: 16px;
}
.menu .menu-badge {
  float: right;
  padding: 0.2rem 0;
}
.menu .menu-badge .btn {
  margin-top: -0.1rem;
}
/* 
  dropdown.scss 
  - Includes all default styles for rendering dropdowns
*/
.dropdown {
  display: inline-block;
  position: relative;
}
.dropdown .menu {
  animation: slide-down 0.15s ease 1;
  display: none;
  left: 0;
  max-height: 50vh;
  overflow-y: auto;
  position: absolute;
  top: 100%;
}
.dropdown.dropdown-right .menu {
  left: auto;
  right: 0;
}
.dropdown.active .menu,
.dropdown .dropdown-toggle:focus + .menu,
.dropdown .menu:hover {
  display: block;
}
.dropdown .btn-group .dropdown-toggle:nth-last-child(2) {
  border-bottom-right-radius: 0.1rem;
  border-top-right-radius: 0.1rem;
}
.navigation {
  background: #f4f4f4;
  display: flex;
  justify-content: flex-start;
  align-items: center;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
}
.navigation a,
.navigation button {
  color: #333;
  font-size: 13px;
  font-weight: 500;
  padding: 0.6em 1em;
  background-color: transparent;
  border: 0;
  display: flex;
  align-items: center;
}
.navigation a:hover,
.navigation a:focus,
.navigation button:hover,
.navigation button:focus {
  cursor: pointer;
  text-decoration: none;
  background: #e6e6e6;
  box-shadow: none;
  outline: 0;
}
.navigation a > i.icon,
.navigation button > i.icon {
  color: hsl(208, 84%, 40%);
  margin-right: 8px;
}
.navigation .dropdown a.dropdown-toggle,
.navigation .dropdown button.dropdown-toggle {
  display: flex;
}
.navigation .menu {
  border: 1px solid #e6e6e6;
  border-radius: 0;
  box-shadow: none;
  padding: 0;
  background-color: #ffffff;
}
.navigation .menu .menu-item {
  padding: 0;
  min-width: 175px;
}
.navigation .menu .menu-item > a,
.navigation .menu .menu-item > button {
  font-size: 11px;
  display: flex;
  width: 100%;
  padding-left: 12px;
  padding-right: 12px;
  justify-content: flex-start;
}
.navigation .menu .menu-item a:hover,
.navigation .menu .menu-item a:focus,
.navigation .menu .menu-item button:hover,
.navigation .menu .menu-item button:focus {
  color: #333;
  background: #f4f4f4;
}
.navigation .nav-item.disabled {
  cursor: not-allowed !important;
  opacity: 0.5;
}

/* 
  Drawer.scss
  - Includes all default styles for the Drawer component
*/
.off-canvas {
  display: flex;
  flex-flow: nowrap;
  height: 100%;
  position: static;
  width: 100%;
}
.off-canvas .off-canvas-toggle {
  display: block;
  position: absolute;
  top: 0.4rem;
  transition: none;
  z-index: 1;
  left: 0.4rem;
}
.off-canvas .off-canvas-sidebar {
  background: #ffffff;
  bottom: 0;
  min-width: 10rem;
  overflow-y: auto;
  z-index: 200;
  position: absolute;
  top: 37px;
  opacity: 1;
  z-index: 98;
  transition: 0.5s all;
  right: 0;
  left: 0;
  transform: translateX(-100%);
}
.off-canvas .off-canvas-sidebar.active {
  opacity: 1;
}
.off-canvas .off-canvas-content {
  flex: 1 1 auto;
  height: 100%;
  padding: 0.4rem 0.4rem 0.4rem 4rem;
}
.off-canvas .off-canvas-overlay {
  background: rgba(33, 33, 33, 0.1);
  border-color: transparent;
  border-radius: 0;
  bottom: 0;
  display: none;
  height: 100%;
  left: 0;
  position: fixed;
  right: 0;
  top: 0;
  width: 100%;
}
.off-canvas .off-canvas-sidebar:target,
.off-canvas .off-canvas-sidebar.active {
  transform: translateX(0);
}
.off-canvas .off-canvas-sidebar:target ~ .off-canvas-overlay,
.off-canvas .off-canvas-sidebar.active ~ .off-canvas-overlay {
  display: block;
  z-index: 100;
}
@media (min-width: 960px) {
  .off-canvas.off-canvas-sidebar-show .off-canvas-toggle {
    display: none;
  }
  .off-canvas.off-canvas-sidebar-show .off-canvas-sidebar {
    flex: 0 0 auto;
    position: relative;
    transform: none;
  }
  .off-canvas.off-canvas-sidebar-show .off-canvas-overlay {
    display: none !important;
  }
}

/* 
  Panel.scss 
  - Includes all default styles for the Panel component
*/
.bf-editor-panel {
  width: 320px;
  max-width: 100%;
  box-shadow: 0 0 2px #DDD;
  background-color: #FFF;
  bottom: 0;
  position: absolute;
  top: 37px;
  left: 0;
}
.bf-editor.right .bf-editor-panel {
  left: unset !important;
  right: 0 !important;
}
.bf-editor-panel .panel-container {
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  overflow: auto;
}
.bf-editor-panel .panel-header {
  background-color: #FFF;
  padding: 16px 16px;
}
.bf-editor-panel .panel-header h2 {
  font-size: 0.55rem;
  text-transform: uppercase;
  font-weight: 500;
  color: #998899;
  margin: 0;
}
.bf-editor-panel .panel-header .btn-close {
  font-size: 0.6rem;
  background: none;
  border: 0;
  padding: 0 4px;
}
.bf-editor-panel .panel-body {
  padding: 0px 16px;
  padding-bottom: 16px;
}
.bf-editor-panel > .react-resizable-handle {
  content: "....";
  width: 15px;
  bottom: 0;
  top: 0;
  display: block;
  overflow: hidden;
  line-height: 5px;
  padding: 3px 4px;
  cursor: move;
  vertical-align: middle;
  font-size: 12px;
  font-family: sans-serif;
  letter-spacing: 2px;
  color: #cccccc;
  text-shadow: 1px 0 1px black;
  position: absolute;
  right: -5px;
}
.bf-editor.right .bf-editor-panel > .react-resizable-handle {
  right: unset !important;
  left: -5px !important;
  display: none !important;
}
.bf-editor-panel > .react-resizable-handle:hover {
  cursor: col-resize;
}
.bf-editor-panel > .react-resizable-handle::after {
  content: ".. .. .. ..";
  right: 3px;
  display: block;
  position: absolute;
  top: 50%;
  margin-top: -10px;
}

